I'm trying to create a rust app that can read the contents of the clipboard aloud using the elevenlabs.io api. I've been looking at the documentation for the elevenlabs.io api and the `clipboard` crate, but I'm not sure how to put it all together.

Here's what I have so far:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, Box<dyn Error>> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().await?;

    let response = text_to_speech(&client, &text).await?;
    println!("{:?}", response);

    Ok(())
}
```

This code will read the contents of the clipboard and print the response from the elevenlabs.io api, but I'm not sure how to actually play the audio.

I've looked at the `rodio` crate, but I'm not sure how to use it with the response from the elevenlabs.io api.

Can someone help me figure out how to play the audio from the response?

Thanks!

## Answer (1)

You can use the `rodio` crate to play the audio. Here's an example of how you can modify your code to play the audio:

```
use clipboard::ClipboardProvider;
use reqwest::Client;
use serde::Deserialize;
use std::error::Error;
use rodio::{Decoder, Sink, Source};

#[derive(Deserialize)]
struct TextToSpeechResponse {
    audio: String,
}

async fn text_to_speech(client: &Client, text: &str) -> Result<TextToSpeechResponse, Box<dyn Error>> {
    let response = client
        .post("https://api.elevenlabs.io/v1/text-to-speech/21m00Tcm4TlvDq8ikWAM")
        .header("xi-api-key", "YOUR_API_KEY")
        .json(&json!({
            "text": text,
            "voice_settings": {
                "stability": 0.5,
                "similarity_boost": 0.75,
            }
        }))
        .send()
        .await?
        .json()
        .await?;

    Ok(response)
}

#[tokio::main]
async fn main() -> Result<(), Box<dyn Error>> {
    let client = Client::new();
    let text = ClipboardProvider::new().get_contents().await?;

    let response = text_to_speech(&client, &text).await?;
    let audio_data = response.audio.as_bytes();
    let source = Decoder::new(audio_data).unwrap();
    let (_stream, stream_handle) = rodio::OutputStream::try_default().unwrap();
    stream_handle.play_raw(source.convert_samples());
    Ok(())
}
```

This code will play the audio from the response using the `rodio` crate.

 I'm using typeorm with postgres and I want to store json in my entity. How can I do that?

## Answer (1)

You can use `json` or `jsonb` type in PostgreSQL. In TypeORM you can use `JsonObject` or `JsonArray` types.

```
@Entity()
export class MyEntity {
  @Column('json')
  myJson: JsonObject;
}
```

